export const styles = {
    navbar: {
        backgroundcolor: 'black'
    },
    figure: {
        height: '5em',
        width: '5em',
        hover: {
            backgroundcolor: 'rgba(255, 255, 224, 0.050)',
            transition: 'all 0.50s ease - out'
        },
    },

    figure: {
        hover: {
            backgroundcolor: 'rgba(255, 255, 224, 0.050)',
            transition: 'all 0.50s ease - out'
        },
    },

    toggle: {
        backgroundcolor: 'white'
    },

    link: {
        color: 'white',
        cursor: 'pointer'
    },

    link: {
        hover: {
            color: 'lightyellow',
            backgroundcolor: 'rgba(255, 255, 224, 0.226)',
            transition: 'all 0.50s ease - out'
        }
    }

}
